import "./App.css";
import React from "react";
import { Route, Routes } from "react-router-dom";
import Login from "../Login/Login";
import Dummy from "../Dummy";

const App = () => {
  return (
    <div className="App">
      <Routes>
        <Route exact path="/login" component={Login} />
      </Routes>
      <Dummy></Dummy>
    </div>
  );
};

export default App;
